script: |
  super -f text -I q1648.spq | sort > q1648.out

inputs:
  - name: q1648.spq
    data: |
      SELECT DISTINCT col0 * 94 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT - + col2 + - + col1 NOT IN ( - ( - col0 ) * - ( - col0 ) / - 88 );
  - name: tab1

outputs:
  - name: q1648.out
    data: |
